import React, {Component} from 'react';


class CreatePost extends Component {
    constructor () {
        super();

        this.state = {
            title: '',
            commentBody: ''
        }
    }


    render () {
        return (

            <div>
                <h2>Create a Post</h2>
                <form onSubmit={this.props.addPost}></form>
            </div>
        )
    }

}
export default CreatePost;
